import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props){

    const {title, amount, date} = props.items[0];
    
    return (
    <div className="expenses">
     
     <ExpenseItem   
        title={title}
        amount={amount}
        date={date}
        />
     

        
    </div>
    );
}

export default Expenses;
